parameters.text:
=Generate an Ideal Customer Profile (ICP) based on the following business information:

- Business Name: {{ $json.body.business.companyName }}
- Website: {{ $json.body.business.website }}
- Industry: {{ $json.body.business.industry }}
- Product Description: {{ $json.body.business.productDescription }}
- Pain Point Solved: {{ $json.body.business.painPoint }}

Generate an ICP based on this information, including relevant details about target industries, company size, revenue range, geographies, key roles, and pain points.

parameters.inputSchema:
{
  "$schema": "https://json-schema.org/draft/2020-12/schema",
  "$id": "https://yourdomain.com/schemas/icp-schema.json",
  "title": "Ideal Customer Profile Schema",
  "description": "A schema for validating the generated Ideal Customer Profile (ICP) based on business input, aligned with Apollo.io filters.",
  "type": "object",
  "properties": {
    "industries": {
      "type": "array",
      "description": "A list of industries that the ideal customer operates in, e.g., 'SaaS', 'Technology', 'Healthcare'.",
      "items": {
        "type": "string"
      }
    },
    "company_size": {
      "type": "array",
      "description": "A list of ideal company size ranges using Apollo.io's predefined values.",
      "items": {
        "type": "string",
        "enum": [
          "1-10",
          "11-20",
          "21-50",
          "51-100",
          "101-200",
          "201-500",
          "501-1000",
          "1001-2000",
          "2001-5000",
          "5001-10000",
          "10000+"
        ]
      }
    },
    "locations": {
      "type": "array",
      "description": "The regions or countries where the ideal customer is located, e.g., ['United States', 'Canada'].",
      "items": {
        "type": "string"
      }
    },
    "job_titles": {
      "type": "array",
      "description": "List of decision-making roles or titles in the ideal customer company, e.g., ['CTO', 'Head of Engineering', 'Operations Manager'].",
      "items": {
        "type": "string"
      }
    },
    "pain_points": {
      "type": "array",
      "description": "List of pain points that the business solves for the ideal customer, e.g., ['Teams waste time switching between tools'].",
      "items": {
        "type": "string"
      }
    }
  },
  "required": ["industries", "company_size", "locations", "job_titles", "pain_points"]
}

